import { Button, ListGroup } from "react-bootstrap";
const AppointmentInfo = ({appt})=>{
    return(
            <>
            
                  <ListGroup.Item>
                    <p><small>Date: {appt.appDate}</small></p>
                    <p><small>First Name: {appt.firstName}</small></p>
                    <p><small>Last Name: {appt.lastName}</small></p>
                    <p><small>Note: {appt.aptNote}</small></p>
                    <Button size="sm" variant="danger">Delete</Button>
                  </ListGroup.Item>
                 
            </>
    );
}

export default AppointmentInfo;
